measurements.description:
Five large, stunning flowers arranged evenly on one 12.5-cm inflorescence;
	sepals and petals slightly undulate, olive green heavily overlaid cordovan, spotted darker cordovan distal two-thirds, 
 undulate margins;
	lip cream-white, trilobed, heavily veined dark magenta, mid-lobe broad, fan-shaped, slightly ruffled, throat bright yellow,
	side lobes closed over column;
	column white blotched dark magenta;
	substance firm; texture satiny; commended for size and floriferousness.
